import React, { Component } from 'react'
import { Link } from 'react-router-dom'

export default class Respuesta extends Component {
    render() {
        return (

            <li className="list-group-item p-0 my-3 border-0">
                <div className="media">
                    <img className="align-self-start mr-3 rounded-circle border" src={'https://laboratoriosniam.com/wp-content/uploads/2018/07/michael-dam-258165-unsplash_WEB2.jpg'} width="36" height="36" />
                    <div className="media-body">
                        <Link className="mt-0" to="/perfil">Gabriela Astudillo</Link>
                        <a href="className=#v-pills-home" className="mr-2"><strong></strong></a>
                        <p>Cras sit amet nibh libero, in gravida nulla. Nulla vel metus scelerisque ante sollicitudin. Cras purus odio, vestibulum in vulputate at, tempus viverra turpis. Fusce condimentum nunc ac nisi vulputate fringilla. Donec lacinia congue felis in faucibus.</p>
                    </div>
                </div>


            </li>
        )
    }
}
